import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'votingPage';
  lastName:string ="";
  search:boolean=true;
  results: any[] = []; // Para almacenar los resultados
    ranges: any[] = [
      { initA: 'ABALOS', initB: 'ROSSO', endA: 'CAMACHO', endB: 'HUANCA', tableNum: 4, classRoom: 507 },
      { initA: 'CAMACHO', initB: 'KOYO', endA: 'CUENCA', endB: 'FELIPE', tableNum: 5, classRoom: 508 },
      { initA: 'CUENTAS', initB: 'AGUILAR', endA: 'HUANCA', endB: 'LUMPE', tableNum: 6, classRoom: 509 },
      { initA: 'HUANCA', initB: 'MAMANI', endA: 'MENDOZA', endB: 'CHOQUE', tableNum: 7, classRoom: 511 },
      { initA: 'MENDOZA', initB: 'COLQUE', endA: 'QUISPE', endB: 'GUZMAN', tableNum: 8, classRoom: 512 },
      { initA: 'QUISPE', initB: 'HUANCA', endA: 'TARQUI', endB: 'VARGAS', tableNum: 9, classRoom: 513 },
      { initA: 'TEJERINA', initB: 'CHACA', endA: 'ZURITA', endB: 'VEIZAGA', tableNum: 10, classRoom: 514 }
    ];
  seeClassRoom(){
    if(this.lastName.trim()=="")return alert("Ingresa tu apellido")
    this.search = false;

        // Dividir lastName en partes (por ejemplo, apellido paterno y materno)
        const lastNameParts = this.lastName.trim().toUpperCase().split(" ");

        // Limpiar resultados anteriores
        this.results = [];

        // Buscar en el rango
        this.results = this.ranges.filter(range => {
          // Convertir a mayúsculas para que la búsqueda sea insensible a mayúsculas/minúsculas
          const initA = range.initA.toUpperCase();
          const initB = range.initB.toUpperCase();
          const endA = range.endA.toUpperCase();
          const endB = range.endB.toUpperCase();

          // Verificar si las partes del apellido ingresado coinciden con alguna de las partes de los apellidos
          return lastNameParts.every(part => {
            return (
              (initA.includes(part) || initB.includes(part) || endA.includes(part) || endB.includes(part))
            );
          });
        });

        if (this.results.length === 0) {
          alert("No se encontraron coincidencias.");
        } else {
          this.search = false;
        }
  }

  clean(){
    this.search = true;
  }
}

<div class="">
  <h1 class="text2 head"><span class="text-primary">SIAT</span> - <span class="text-warning">NIC</span></h1>


  <div class="container" *ngIf="search">
    <p class="text2">Encuentra tu aula de votación 😉🗳</p>
    <div class="row  justify-content-center">
      <div class="col-md-6 col-lg-4 ">
        <div class="d-flex flex-column align-items-center">
        <input type="text" class="form-control" [(ngModel)]="lastName" placeholder="Ingresa tu apellido">
        <button type="button" (click)="seeClassRoom()"  class="btn btn-primary text mt-2"> BUSCAR <i class="bi bi-search"></i></button>
        </div>
      </div>
    </div>

    <div class="col-12 d-flex justify-content-center align-items-center">
      <img class="mt-3 img-fluid" src="assets/img/primero.jpg" alt="logo" width="700">
    </div>
  </div>

  <div class="container" *ngIf="!search">
    <h2 class="text2">AULA DE VOTACIÓN</h2>
    <div class="row  justify-content-center">
      <div class="col-md-6 col-lg-4 ">
        <div class="d-flex flex-column align-items-center">
        <button type="button" (click)="clean()"  class="btn btn-primary text mt-2"> BUSCAR NUEVAMENTE <i class="bi bi-search"></i></button>
        </div>
      </div>
    </div>

    <div class="col-12 d-flex justify-content-center align-items-center">
      <img class="mt-3 img-fluid" src="assets/img/segundo.jpg" alt="logo" width="700">
    </div>
  </div>
</div>
